import React from 'react';
import styles from './Counter.module.css';
import {Link} from 'react-router-dom';

const Counter = (props) => {
    return(
        <div>
            <Link to="/editing"/>
            <button className={styles.button}> {props.name} </button>
        </div>
    );
};

export default Counter;
